import React, { Fragment } from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import { BrowserRouter, Route, Switch, Link } from 'react-router-dom';
import axios from 'axios';
import TextFields from './Fields';
import { Grid, Paper, Typography } from '@material-ui/core';

//ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA


const style = {
    root: {

        flexGrow: 1

    },
    paper: {
        padding: 30,
        marginTop: 10,
        marginBottom: 10,
        marginLeft: 10,
        marginRight: 10,
        height: 500,
        overflowY: 'auto'
    }
};

class Hello extends React.Component {



		state = {
            file_url: '',
            highway:{},
            cost: ''


        };




	 handleEditChange = name => event => {
        this.setState({
            highway: {
                ...this.state.highway,
                [name]: event.target.value
            }

        })


    };

	 onSubmission = () => {

            return axios.get('http://localhost:8000/calc/' , {
                    params: {
                      mileage : this.state.highway.num,
                        vehicle: this.state.highway.VehicleType,
                        transponder: this.state.highway.transponder,
                        time: this.state.highway.Time,
                        hour: this.state.highway.hour,

                  }


            })

            .then((response) => {

                this.setState({cost: response.data})
                console.log(response)
         });
}


	getVideos = () => {


        return axios.get('http://localhost:8000/watch3')
            .then((response) => {

            	this.setState({file_url:response.data});

                console.log(response)
            });

    };




	render() {

	    console.log(this.state.highway)
        const { highway } = this.state

        return (
        	<div>

				<Grid container spacing={8}>
            <Grid item xs={6}>

                <Paper style={style.paper}>



                    <Fragment>

                        <TextFields

                            handleEditChange={this.handleEditChange}
                            highway={highway}
                            onSubmission={this.onSubmission}
                        />

                        <Typography variant='title'>



                        </Typography>

                    </Fragment>

                </Paper>
            </Grid>
            <Grid item xs={6}>
                <Paper style={style.paper}>

                  <Fragment>
                    <Typography variant="headline">

                        Applicable Toll Charges



                    </Typography>
                    <Typography variant="title" style={{marginTop:20}}>

                        $ {this.state.cost}

                    </Typography>
                  </Fragment>

                </Paper>
            </Grid>
        </Grid>



            </div>
		)
	}



};



ReactDOM.render(<BrowserRouter>
				<div>

					<App/>


					<Switch>
						<Route path="/Yusuf" component={Hello} />

					</Switch>
				</div>
				</BrowserRouter>
	, document.getElementById('root'));

serviceWorker.unregister();
